package Json;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.Serializable;
import java.sql.Connection;
import java.sql.SQLException;
import java.util.ArrayList;
import java.util.Map;

import javax.faces.bean.ManagedBean;
import javax.faces.bean.ViewScoped;
import javax.faces.context.ExternalContext;
import javax.faces.context.FacesContext;
import javax.imageio.ImageIO;

import org.json.simple.JSONArray;
import org.json.simple.JSONObject;

import schooldata.DataBaseConnection;
import schooldata.DatabaseMethods1;
import schooldata.StudentInfo;

@ManagedBean(name="addStudentFeeDetailsIos")
@ViewScoped
public class AddStudentFeeDetailsIosJson implements Serializable {


	String json;

	ArrayList<StudentInfo> list;
	DataBaseMeathodJson DBJ=new DataBaseMeathodJson();

	public AddStudentFeeDetailsIosJson() {

		Connection conn=DataBaseConnection.javaConnection();
		
		try {
			
		} catch (Exception e) {
			// TODO: handle exception
		}
		finally 
		{
			
		}

		Map<String, String> params =FacesContext.getCurrentInstance().
				getExternalContext().getRequestParameterMap();
		String studentid = params.get("studentid");
		String schoolid = params.get("Schoolid");
		String feeAmount=params.get("amount");
		String paidby=params.get("paid");
		String chequeno=params.get("ctnno");
		String review = params.get("month");
		String imagePath = params.get("image");
		//	String imagePath="";
		Map<String, String> sysParams =FacesContext.getCurrentInstance().
				getExternalContext().getRequestHeaderMap();
		String userAgent = sysParams.get("User-Agent");
		boolean checkRequest = DBJ.checkRequestAuthenticity(userAgent); // If true, proceed else block
		String status = "not updated";
		if(checkRequest)
		{
			int rendomNumber=0;
			String name="";
			if(!imagePath.equals(""))
			{

				imagePath=imagePath.replaceAll(" ", "+");
				new DatabaseMethods1(schoolid).fileCreation(imagePath,conn);

				byte[] imageByte = javax.xml.bind.DatatypeConverter.parseBase64Binary(imagePath);
				try {
					BufferedImage img = ImageIO.read(new ByteArrayInputStream(imageByte));
					rendomNumber=(int)(Math.random()*9000)+1000;
					name="fee"+String.valueOf(rendomNumber)+".jpg";
					DBJ.makeScanPathIOS11(img,name,schoolid,conn);

				}
				catch (IOException e) {

					e.printStackTrace();
				}


			}



			int i=DBJ.SchoolfeeDeatilsForJson(studentid, review,name,feeAmount,paidby,chequeno,schoolid,conn);

			//  ArrayList<NotificationInfo> info=new DatabaseMethods1().allMessageforapp(studentid);

			if(i>0)
			{
				DBJ.adminnotification("Fees Details","New Fee Details Added", "admin-"+schoolid,schoolid,"FeeDetail-"+studentid,conn);
				status="updated";
			}
			else
			{
				status="not updated";
			}
		}
		
		JSONObject mainobj = new JSONObject();
		JSONArray arr=new JSONArray();

		JSONObject obj = new JSONObject();
		obj.put("status",status);

		arr.add(obj);

		mainobj.put("SchoolJson", arr);

		json=mainobj.toJSONString();

		try {
			conn.close();
		} catch (SQLException e) {
			e.printStackTrace();
		}
	}


	public void renderJson() throws IOException {
		FacesContext facesContext = FacesContext.getCurrentInstance();
		ExternalContext externalContext = facesContext.getExternalContext();
		externalContext.setResponseContentType("application/json");
		externalContext.setResponseCharacterEncoding("UTF-8");
		externalContext.getResponseOutputWriter().write(json);
		facesContext.responseComplete();


	}


}
